  const [selectedImg, setSelectedImg] = useState(null);
  const [docs, setDocs] = useState(null);

  return (
    <div className={Classes.Home}>
      <ImageLoading />
      {<ImageGrid />}
    </div>
  );
};

export default Home;

const { docs } = useFirestore("images");
